css:
@-moz-document domain("feedback.discordapp.com") {
.headerBar { background-color: #1E2124; }
.uvBody { background-color: #36393E; background-image: none; color: #EEEEEE; }
.uvCustomPrimary-color { color: #EEEEEE; }
.uvField { background-color: #424549; }
.uvFieldPlaceholder { color: #616367; }
.uvIdeaDescription { color: #ACB9BB; }
.uvIdeaVoteCount { background-color: #2E3136; }
.uvIdeaVoteCount strong { color: #6F7E81; }
.uvModule { background-color: #2E3136; }
.uvModule-session .vcard a { color: #EEEEEE; }
.uvUserActionBody { color: #ACB9BB; }
.uvUserSettingsFieldsetLegend { color: #EEEEEE; }
.uvFooter { background-color: #2e3136; }
.uvPagination a { background-color: #1e2124; }
.uvPagination span { color: #00b1f7; background-color: #1e2124; }
.uvModule-feedback .uvStyle-count { color: #1e2124; font-weight: bold; }
}
